import { Registered } from './Registered';
import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
// import { Header } from './Header';

function Register() {
  const [formValue, setFormValue] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: '',
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;

    setFormValue({
      ...formValue,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // здесь обработчик регистрации
  };

  return (
    <>
      <form className="enterance-form" onSubmit={handleSubmit} name={'sign-up'}>
        <h1 className="enterance-form__title">Регистрация</h1>
        <input
          className="enterance-form__input"
          placeholder="Email"
          id="email"
          name="email"
          type="text"
          value={formValue.email}
          onChange={handleChange}
        />
        <input className="enterance-form__input" placeholder="Пароль" />
        <button className="enterance-form__submit-button" type="submit">
          Зарегистрироваться
        </button>
      </form>
      <Registered />
    </>
  );
}

export { Register };

